import React, {Component} from 'react';
import { Helmet } from 'react-helmet'

const title = "Projects|Alper Tunca";

class Projects extends Component {
    render() {
        const divStyle = {
            width: "100%",
            background: "#1F1E1A"
        };

        const linkStyle = {
            color: "#34A4EB",
            cursor: "pointer"
        };

        return (
            <div style={divStyle}>
                <Helmet>
                    <title>{title}</title>
                </Helmet>
                <h1>PROJECT</h1>
                <h2>HELLO WORLD</h2>
            </div>
        );
    }
}

export default Projects;
